import React, { useState } from 'react';

function logOut(props) {
    const [log_out, setlog_out] = useState(false);
    function logout() {
        sessionStorage.clear();
        setlog_out(true)
    }
    return (
        <div class='topright'>
            <a href="http://localhost:3000"><button class='other_buttons' onClick={logout}>
                LogOut
            </button></a>
        </div>
    );
}

export default logOut
